import React, { useState, useEffect } from 'react';

import { makeStyles } from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';

import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Button from '@material-ui/core/Button';
import EditIcon from '@material-ui/icons/Edit';
import Title from './Title';

function preventDefault(event) {
    event.preventDefault();
  }

  const useStyles = makeStyles((theme) => ({
    seeMore: {
      marginTop: theme.spacing(3),
    },
  }));

  // Hooks API data fetching
  export default function MyComponent() {
    const [error, setError] = useState(null);
    const [isLoaded, setIsLoaded] = useState(false);
    const [items, setItems] = useState([]);

    // Note: the empty deps array [] means
    // this useEffect will run once
    // similar to componentDidMount()
    useEffect(() => {
      fetch("http://javareesbyapi-env.eba-rtdeyeqd.ap-southeast-2.elasticbeanstalk.com/api/v1/getallclients/tenant/reesby")
        .then(res => res.json())
        .then(
          (result) => {
            setIsLoaded(true);
            setItems(result);
          },
          // Note: it's important to handle errors here
          // instead of a catch() block so that we don't swallow
          // exceptions from actual bugs in components.
          (error) => {
            setIsLoaded(true);
            setError(error);
          }
        )
    }, [])

    const classes = useStyles();
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
        <React.Fragment>
          <CssBaseline />
          <Container>
            <Title>Recent Orders</Title>
            <Table size="small">
              <TableHead>
                <TableRow>
                  <TableCell>
                    <FormControlLabel
                      control={<Checkbox value="remember" color="primary" />}
                    />
                  </TableCell>
                  <TableCell>Client Name</TableCell>
                  <TableCell>Email</TableCell>
                  <TableCell>Phone</TableCell>
                  <TableCell>Industry</TableCell>
                  <TableCell>Point Of Contact</TableCell>
                  <TableCell>Website</TableCell>
                  <TableCell></TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {items.map((item) => (
                  <TableRow key={item.clientId}>
                    <TableCell>
                      <FormControlLabel
                        control={<Checkbox value="remember" color="primary" />}
                      />
                    </TableCell>
                    <TableCell>{item.clientName}</TableCell>
                    <TableCell>{item.clientEmail}</TableCell>
                    <TableCell>{item.clientWorkPhone}</TableCell>
                    <TableCell>{item.clientIndustry}</TableCell>
                    <TableCell>{item.clientPocName}</TableCell>
                    <TableCell>{item.clientWebsite}</TableCell>
                    <TableCell><Button variant="outlined" color="primary"><EditIcon></EditIcon></Button></TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </Container>
        </React.Fragment>
      );
    }
  }
